textStart = "–ü—Ä–∏–≤–µ—Ç! –Ø –±–æ—Ç-–∑–∞–±–æ—Ç–∞ ‚òïüç™ –î–≤–∏–∂–µ–Ω–∏—è –ø–µ—Ä–≤—ã—Ö –≥–æ—Ä–æ–¥–∞ –ù–æ—è–±—Ä—å—Å–∫–∞ –ï—Å–ª–∏ –µ—Å—Ç—å —Å–ª–æ–∂–Ω–æ—Å—Ç–∏ - —è –≥–æ—Ç–æ–≤ –ø–æ–º–æ—á—å, –∂–º–∏ –∫–Ω–æ–ø–∫—É '–°—Ç–∞—Ä—Ç' –∏ –¥–∞–ª–µ–µ –∂–º–∏ –∫–Ω–æ–ø–∫—É —Å —Ç–µ–º–æ–π –≤–æ–ø—Ä–æ—Å–∞‚¨áÔ∏è –°–Ω–∞—á–∞–ª–∞ —è –Ω–∞–ø—Ä–∞–≤–ª—é —Ç–µ–±—è –Ω–∞ –æ—Ñ–∏—Ü–∏–∞–ª—å–Ω—ã–π —Å–∞–π—Ç, –≤–æ–∑–º–æ–∂–Ω–æ, —Ç–∞–º —Ç—ã –Ω–∞–π–¥–µ—à—å –æ—Ç–≤–µ—Ç—ã –Ω–∞ —Å–≤–æ–∏ –≤–æ–ø—Ä–æ—Å—ãüõü –ï—Å–ª–∏ —ç—Ç–æ –Ω–µ –ø–æ–º–æ–≥–ª–æ, —Ç–æ –∂–º–∏ –∫–Ω–æ–ø–∫—É –ü–æ–º–æ—â—å –¥—Ä—É–≥–∞, —Å–æ–æ–±—â–∏ —Å–≤–æ–∏ –¥–∞–Ω–Ω—ã–µ, –∏ –Ω–∞—Å—Ç–∞–≤–Ω–∏–∫ –∏–∑ '–î–≤–∏–∂–µ–Ω–∏—è –ø–µ—Ä–≤—ã—Ö', –ø–æ–º–æ–∂–µ—Ç —Ç–µ–±–µ –≤ —Ç–µ—á–µ–Ω–∏–µ 3 —Ö —Ä–∞–±–æ—á–∏—Ö –¥–Ω–µ–πüíå"